const IMAGE_DIR = path.join(__dirname, 'public', 'images');
const MAX_RETRIES = 3;
const TIMEOUT = 10000; // 10 seconds

// ðŸ”¹ Create image directory
fs.mkdirSync(IMAGE_DIR, { recursive: true });

// ðŸ”¹ URL cache to avoid duplicate downloads
const urlCache = new Map();

// ðŸ”¹ Get clean extension from URL
const getExtension = (imageUrl) => {
    try {
        const cleanPath = new URL(imageUrl).pathname.split('?')[0];
        const ext = path.extname(cleanPath).toLowerCase();
        return ['.jpg', '.jpeg', '.png', '.gif', '.webp'].includes(ext) ? ext : '.jpg';
    } catch {
        return '.jpg';
    }
};

// ðŸ”¹ Sanitize filename
const sanitizeFilename = (filename) => {
    return filename.replace(/[^a-z0-9.-]/gi, '_');
};

// ðŸ”¹ Download with retry logic
const downloadImage = async (url, filename, retries = 0) => {
    const filePath = path.join(IMAGE_DIR, filename);

    try {
        // Check if already downloaded
        if (fs.existsSync(filePath)) {
            console.log(`âš¡ Using cached: ${filename}`);
            return `/images/${filename}`;
        }

        console.log(`ðŸ“¥ Downloading: ${filename}...`);

        const response = await axios({
            url,
            method: 'GET',
            responseType: 'stream',
            timeout: TIMEOUT,
            headers: {
                'User-Agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36'
            }
        });

        // Validate content type
        const contentType = response.headers['content-type'];
        if (!contentType || !contentType.startsWith('image/')) {
            throw new Error(`Invalid content type: ${contentType}`);
        }

        const writer = fs.createWriteStream(filePath);
        response.data.pipe(writer);

        await new Promise((resolve, reject) => {
            writer.on('finish', resolve);
            writer.on('error', reject);
        });

        // Verify file size
        const stats = fs.statSync(filePath);
        if (stats.size < 100) {
            fs.unlinkSync(filePath);
            throw new Error('Downloaded file too small, likely invalid');
        }

        console.log(`âœ… Downloaded: ${filename} (${(stats.size / 1024).toFixed(2)} KB)`);
        return `/images/${filename}`;

    } catch (error) {
        // Clean up failed download
        if (fs.existsSync(filePath)) {
            fs.unlinkSync(filePath);
        }

        // Retry logic
        if (retries < MAX_RETRIES) {
            console.log(`âš ï¸  Retry ${retries + 1}/${MAX_RETRIES} for ${filename}...`);
            await new Promise(resolve => setTimeout(resolve, 1000 * (retries + 1)));
            return downloadImage(url, filename, retries + 1);
        }

        console.error(`âŒ Failed to download ${filename}: ${error.message}`);
        return null;
    }
};

// ðŸ”¹ Process single image with caching
const processImage = async (url, productIndex, imageIndex, isMain = false) => {
    // Check cache first
    if (urlCache.has(url)) {
        console.log(`ðŸ”„ Reusing URL: ${url}`);
        return urlCache.get(url);
    }

    const ext = getExtension(url);
    const suffix = isMain ? 'main' : imageIndex;
    const filename = sanitizeFilename(`product-${productIndex}-${suffix}${ext}`);

    const localPath = await downloadImage(url, filename);

    if (localPath) {
        urlCache.set(url, localPath);
    }

    return localPath;
};

